// Javascript utility for embedding an NG-CHM into a web page.
//
// The principal exported function is embedNGCHM, which is used to load the embedded NG-CHM.
// There is also a helper function embedNGCHM.setParameters for changing the default embedding parameters.
//
(function () {
  "use strict";

  var sequenceNo = 1; // In case of multiple embedded maps.

  const iframeInfo = {}; // Map info needed by embedded map callback.

  // Parameters for adjusting embedded maps.
  // Call embedNGCHM.setParameters to change (see below).
  const defaultParams = {
    //Path to widget file. If in servers top level web content directory, just use file name
    //to path to another sub-directory within web content: e.g. './subdir/ngchmWidget-min.js'
    //to path to a URL location e.g. 'http://widgetloc.com/ngchmWidget-1.2.0-min.js' (one we have tested with: 'http://cloudflare.com/..../ngchmWidget-1.2.0-min.js')
    widgetPath: "ngchmWidget-min.js",
    //Path to minified source for widget.  Leave null to use widgetPath above.
    widgetSource: null,
    //Optional configuration for iframe
    scrolling: "no",
    style: "height:100vh; width:100vw; border-style:none;",
    //Required sandbox parameters to permit full heat map functionality
    sandbox:
      "allow-scripts allow-same-origin allow-popups allow-forms allow-modals allow-downloads",
    // style of the top-level div within the embedded iframe
    docStyle: "margin: 1em 0 0 5%; width: 90%;",
    // style of the second-level div that contains the embedded NG-CHM
    embedStyle:
      "display: flex; flex-direction: column; background-color: white; height: 80vh; border: 2px solid gray; padding: 5px",
    // style of the thumbnail display
    thumbStyle: "height: 150px; width: 150px; border-style:none;",
    thumbnail:
      "data:image/png;base64,",
    // Path to additional custom JS file
    customJS: "",
    // Optional configuration for expandable NG-CHM display
    expandable: false,
    // Optional onload function on generated iframe
    onload: null,
  };

  // Exported function to be called to embed an NGCHM.
  // - selector a document.querySelector that identifies the DOM element in which to embed the NGCHM
  // - srcType  type of NGCHM source to use. Only implemented value is 'base64' for a base-64 encoded blob.
  // - srcSpec  where to get the embedded NGCHM. Value depends on srcType.  For 'base64', it is the base-64 encoded blob.
  // - params   overrides defaultParams for this specific embedded NGCHM only (optional).
  //
  // Example:
  //   embedNGCHM ('#iFrameDiv', 'base64', base64_NGCHM);
  //
  // embedNGCHM may be called multiple times for different DOM elements to embed multiple maps.
  //
  function embedNGCHM(selector, srcType, srcSpec, params = {}) {
    const P = Object.assign({}, defaultParams, params);
    const embeddedParent = getParentFromSelector(selector);
    if (!embeddedParent) {
      alert('Failed to find target "' + selector + '" for embedded NGCHM');
      return;
    }

    //Exit if no ngchm has been provided
    if (srcSpec === undefined) {
      alert(
        "No source file specified for embedded NGCHM for the embedded parent element: " +
          selector,
      );
      return;
    }

    const ngchmIFrame = document.createElement("iframe");
    ngchmIFrame.id = "i" + selector;
    ngchmIFrame.name = "mapIframe" + sequenceNo;
    sequenceNo++;
    ngchmIFrame.scrolling = P.scrolling;
    ngchmIFrame.sandbox = P.sandbox;
    if (P.onload !== null) {
      ngchmIFrame.onload = P.onload;
    }
    // Save details required by iFrame initialization callback.
    iframeInfo[ngchmIFrame.name] = { srcType, srcSpec };
    //Add Iframe to required DIV
    embeddedParent.appendChild(ngchmIFrame);
    //Construct a fully configured embedded iframe and add it to the html page
    const doc = ngchmIFrame.contentWindow.document;
    doc.open();
    if (P.expandable === true) {
      ngchmIFrame.style = P.thumbStyle;
      doc.write(
        `<!DOCTYPE html><HTML><HEAD><META id="viewport" name="viewport" content="width=device-width,user-scalable=no"></HEAD><BODY style='margin:0px;width:100vw;height: 100vh;display: flex;flex-direction: column;'><div id='NGCHMEmbedWrapper' class='NGCHMEmbedWrapper' style='${P.thumbStyle}'><img id='NGCHMEmbedButton' src='${P.thumbnail}' alt='Show Heat Map' onclick='NgChm.API.showEmbedded(this,"${P.style}","${P.customJS}");' /><div class='NGCHMEmbedOverlay' onclick='NgChm.API.showEmbedded(this,"${P.style}","${P.customJS}");' ><div id='NGCHMEmbedOverText'>Expand<br>Map</div></div></div><div id='NGCHMEmbedCollapse' style='display: none;width: 100px; height: 20px;'><div><img id='NGCHMEmbedButton' src='data:image/png;base64,' alt='Collapse Heat Map' onclick='NgChm.API.hideEmbed("${P.thumbStyle}");' /></div></div><br/><div id='NGCHMEmbed' style='${P.embedStyle}'></div>`,
      );
      S(`src='${P.widgetPath}'`);
    } else {
      ngchmIFrame.style = P.style;
      doc.write(`<!DOCTYPE html><HTML>`);
      doc.write(
        `<META id="viewport" name="viewport" content="width=device-width,user-scalable=no">`,
      );
      doc.write(`<BODY>`);
      doc.write(
        `<div style='${P.docStyle}'><div id='NGCHMEmbed' style='${P.embedStyle}'></div></div>`,
      );
      S(`src='${P.widgetPath}'`);
      if (P.customJS !== "") {
        S(`src='${P.customJS}'`);
      }
    }
    S("", `window.parent.embedNGCHM.setUpFrame("${ngchmIFrame.name}");`);
    doc.write(`</BODY></HTML>`);
    doc.close();
    function S(a, b = "") {
      doc.write(`<script ${a}>${b}<` + "/script>");
    }
  }

  //Retrieve embedded parent element from selector
  function getParentFromSelector(selector) {
    return selector instanceof Element
      ? selector
      : document.querySelector(selector) || document.getElementById(selector);
  }

  // Auxiliary function to override default parameters for all subsequent calls to embedNGCHM.
  //
  embedNGCHM.setParameters = function setParameters(params = {}) {
    Object.entries(params).forEach(([key, value]) => {
      defaultParams[key] = value;
    });
  };

  // Support function to setup the embedded iframe after the NGCHM widget has loaded.
  // The user of this module should *not* call this function directly.
  embedNGCHM.setUpFrame = function setUpFrame(iframeName) {
    const frame = window.frames[iframeName];
    const info = iframeInfo[iframeName];
    if (frame.NgChm == undefined) {
      console.error("NgChm not found on iframe");
      return;
    }
    const API = frame.NgChm.API || frame.NgChm.UTIL;
    if (!frame.NgChm.API) {
      if (frame.NgChm.UTIL) {
        console.warn(
          "Using deprecated NG-CHM widget interface. Please upgrade.",
        );
      } else {
        console.error("Cannot find NG-CHM widget interface");
        return;
      }
    }
    if (info.srcType === "blob") {
      API.embedCHM(info.srcSpec);
    } else if (info.srcType === "base64") {
      API.embedCHM(API.b64toBlob(info.srcSpec));
    } else if (info.srcType === "fileName") {
      API.embedCHM(info.srcSpec);
    } else if (info.srcType === "url") {
      API.embedCHM(info.srcSpec);
    } else {
      alert("Unknown type of embedded NGCHM: " + info.srcType);
    }
  };

  // Export the embedNGCHM function.
  window.embedNGCHM = embedNGCHM;
})();
